import './App.css';

function App() {
  return (
    <div className="bio-marketing-container">
    <div className="logo">
      <h1>Bio <span>Marketing</span> Bulgaria</h1>
    </div>
    <div className="animals">
      <img src="https://dashboard.codeparrot.ai/api/assets/Z0tmw7LVBCaRbmUB" alt="Cat 1" width="150" height="150" />
      <img src="https://dashboard.codeparrot.ai/api/assets/Z0tmw7LVBCaRbmUC" alt="Dog 1" width="150" height="150" />
      <img src="https://dashboard.codeparrot.ai/api/assets/Z0tmw7LVBCaRbmUD" alt="Dog 2" width="150" height="150" />
      <img src="https://dashboard.codeparrot.ai/api/assets/Z0tmw7LVBCaRbmUE" alt="Cat 2" width="150" height="150" />
    </div>
  </div>
  );
}

export default App;
